from datetime import datetime
import numpy as np
import collections


class Solution:
    def minDeletions(self, s: str) -> int:



        ethalon = "abcdefghijklmnopqrstuvwxyz"
        hash_ = {l: ethalon.index(l) for l in ethalon}
        #a = np.zeros((len(ethalon)), dtype=np.int16)
        a = np.int32(np.array(collections.Counter(s).most_common(26))[:,1])
        a.resize(26, refcheck=False)
        answer = 0
        #print(hash_)
        l = len(s)
        #for i in s:
        #    a[hash_[i]] += 1

        #a[::-1].sort()
        outer = True
        while outer:
            i = 0
            keep = True
            while i < 25 and a[i] > 0 and keep:
                if a[i] == a[i+1]:
                    answer += 1
                    a[i] -= 1
                    a[::-1].sort()
                    #np.sort(a)[::-1]
                    keep = False
                else:
                    i += 1
                    if i == 25 or a[i] == 0: outer = False
        return answer




